@Mohandark_s This should give about 5.5 - 6.5 hrs of SOT with a typical full day usage, which is decent for flagships that I get... 

Below 4.5 hrs SOT is bad and that's why I didn't like the Galaxy Note 20 Ultra and didn't use it.

Some current batt life stats for ur refrence was on wifi https://t.co/OC2cWWEGnl

@kingsman_vishnu Not on all products I don't claim GST on every product only those that are going to be used in office.

Also you generally don't get GST input on new products that were just launched most of the time on these online sites.

Also it's called GST Input can't claim on everything.

@andy1_andy2 I hate Xiaomi India PR team, they can't take constructive criticism.

I shouted about Ads situation last year gald I did that coz now Ads situation is now so much better on this phone.

They improved earpiece quality also so if my ranting get things noticed so be it that way.

@ShibiPayamal I don't have other variants I could only purchase the Redmi Note 10 till now.

But to be frank this smartphone exceeded my internal expectations and that generally is a very rare thing. 

Overall impressed apart from some MiUi software stuff and software bugs.

@OmBhimani1 I had Act, Pioneer broadband and Jio Fiber and now getting Airtel Fiber.

Act used to be great earlier but now very poor, Jio has been great in terms of uptime hardly had any downtime but pings response are higher than ACT.

Let's see how is this Airtel Fiber.

@vinky_sid A laptop is a laptop and tablet is a tablet if you want to serious work then go for laptop. 

If its mostly content consumption and light actual work you can go with a tablet. 

I tried using tablet as laptop replacement and it failed miserably.

@enlighten_pixel Yeah pretty fast this can sustain about 900 MB/sec the older T5 I used to get about 500 MB/sec transfers.

We do sometimes put 3 different 4K videos files on a timeline and edit via this and don't have any issues.

I don't store critical documents on external storage though.

@PrasaanthSekar That's very surprising I used it  with my Jio sim as of now and it's been fine for me, of course where I stay I have good cellular signal.

Did you do a clean fresh install or a migration from backup?

If migration then try a clean install and see if that fixes it.

