@utsavtechie Some of the soundbar will simply not give the ATMOS support unless its being passed via eARC from the TV. 

Example the Sony G700 soundbar I am testing does not pass ATMOS via arc unless your TV has eARC support so had to use Xbox.

So its better to make everything is compatible.
